import React from 'react';

const button = (props) => {

    const buttonStyle = {
        backgroundColor: '#483D53',
        border: 'none',
        padding: '20px 40px',
        width: '250px',
        // position: 'absolute',
        marginTop: '5%',
        marginLeft: '-10%',
        cursor: 'pointer',
        // color: '#FFFFFF',
        // textDecoration: 'none',
        // letterSpacing: '2px',
        // fontSize: '20px',
        // textAlign: 'center',
        // display: 'inline-block',
    }

    return (
        <div>
            <button style={buttonStyle}>
                {props.name}
            </button>
        </div>
    )
}

export default button
